import React from "react";
import "./Heading.css";

const Heading = () => {
  return (
    <heading className="heading">
      <div className="header_text">
        <div className="header_text__own_your_audience">Own your audience.</div>
        <div className="header_text__gradient_text">So you don't lose them</div>
      </div>
      <div className="button-text">
        <div className="button-text__heading_text">
          Turn your audience into email and text message subscribers.
        </div>
        <div className="button-text__buttons">
          <button className="button-text__button_get-started">
            Get Started Now
          </button>
          <button className="button-text__button_view">View A Demo</button>
        </div>
        <div className="button-text__counter">
        <div className="button-text__counter_dot"></div>
        <div className="button-text__counter_dot_center"></div>
        <div className="button-text__counter_text"></div>
        </div>
      </div>
    </heading>
  );
};

export default Heading;
